import React, { useEffect, useRef } from 'react';
import PropTypes from 'prop-types';
import { Avatar, Col, List, Row, Space } from 'antd';
import { API_KEY } from '../../constants/api-keys';
import LazyLoadImg from '../LazyLoadImg/LazyLoadImg';

ListViewTest.propTypes = {};

function ListViewTest({ onClick, current }) {
	const imgurl = API_KEY.IMAGE_URL;

	return (
		<Row>
			{current?.map((movie) => (
				<div key={movie.id}>
					<LazyLoadImg url={`${imgurl}${movie.poster_path}`} />
				</div>
			))}
		</Row>
	);
}

export default ListViewTest;
